package JavaPackage;

public class UnaryOperator1 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a=1;
		System.out.println(a++);  //1,2
		System.out.println(a);
		System.out.println(a++);
		System.out.println(a);
		
		System.out.println(++a); //4,4
		System.out.println(a); //4

	}

}
